import React from "react";
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import mark from './icons/mark.png';
import L from 'leaflet';

function MapContacto() {
    const position = [-40.5725, -73.1353];

    let loveIcon = L.icon({
        iconUrl: mark,
        iconRetinaUrl: mark,
        iconAnchor: [5, 55],
        popupAnchor: [10, -44],
        iconSize: [30, 35],
    });

    return (
        <MapContainer
            className="map"
            center={position}
            zoom={14}
            style={{ height: 300, width: "100%" }}
        >
            <TileLayer
                attribution='&amp;copy <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
                url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
            />
            <Marker position={position} icon={loveIcon}>
                <Popup>
                    Corretajes Bulltechs.
                </Popup>
            </Marker>
        </MapContainer>
    );
}

export default MapContacto;
